  width: 100%;
  flex: 0 0 100%;
}
#ANSlogbox .span:not(.full-display) > span:last-child {
  flex: 0 0 calc(100% - 20px);
}
.content_string_formater {
  background: #fff;
  color: #000;
  margin-top: 15px;
  padding: 15px;
  white-space: pre;
  height: 200px;
  overflow: auto;
}
/* STYLE TOGGLE*/
.div_content_toogle {
  display: flex;
  align-items: center;
  justify-content: end;
  width: 100%;
  position: relative;
  font-family: 'Segoe UI Semibold', wf_segoe-ui_semibold, helvetica, arial, sans-serif;
}
.toggleContainer {
  position: relative;
  display: grid;
  grid-template-columns: repeat(2, 1fr);
  width: fit-content;
  border: 3px solid #079d1d;
  border-radius: 20px;
  background: transparent;
  font-weight: bold;
  color: #343434;
  cursor: pointer;
}
.toggleContainer::before {
  content: '';
  position: absolute;
  width: 50%;
  height: 100%;
  left: 0%;
  border-radius: 20px;
  background: #079d1d;
  transition: all 0.3s;
}
.toggleCheckbox:checked + .toggleContainer::before {
  left: 50%;
}
.toggleContainer div {
  padding: 3px 12px;
  text-align: center;
  z-index: 1;
  height: 23px;
  font-size: 12px;
}
.toggleCheckbox {
  display: none;
}
.toggleCheckbox:checked + .toggleContainer div:first-child {
  color: white;
  transition: color 0.3s;
}
.toggleCheckbox:checked + .toggleContainer div:last-child {
  color: #ffffff;
  transition: color 0.3s;
}
.toggleCheckbox + .toggleContainer div:first-child {
  color: #ffffff;
  transition: color 0.3s;
}
.toggleCheckbox + .toggleContainer div:last-child {
  color: white;
  transition: color 0.3s;
}
/*STYLE TABLE*/
.content_table_formater,
.content_table_formater *,
.content_table_formater ::after,
.content_table_formater ::before {
  box-sizing: border-box;
}
.content_table_formater {
  display: none;
  width: 100%;
  overflow: auto;
  max-width: 100%;
  background-color: #fff;
  margin: 20px 0 0 0;
  -webkit-overflow-scrolling: touch;
  -ms-overflow-style: -ms-autohiding-scrollbar;
}
.formatjson span.open .content_string_formater {
  display: none !important;
}
.formatjson span.open .content_table_formater {
  display: block !important;
}
.content_table_formater .table {
  width: 100%;
  max-width: 100%;
  margin-bottom: 1rem;
  background-color: transparent;
}
.content_table_formater .table {
  border-collapse: collapse;
}
.content_table_formater .table td,
.content_table_formater .table th {
  padding: 0.75rem;
  vertical-align: top;
  border-top: 1px solid #dee2e6;
}
.content_table_formater .table th {
  text-align: inherit;
}
.content_table_formater .table thead th {
  vertical-align: bottom;
  border-bottom: 2px solid #dee2e6;
}
.content_table_formater .table td,
.content_table_formater .table th {
  padding: 0.75rem;
  vertical-align: top;
  border: 1px solid #dee2e6;
}
.content_table_formater .table td span.key,
.content_table_formater .table th span.key {
  display: block;
  width: 100%;
  /*padding: 0.75rem;*/
  white-space: nowrap;
  background-color: #0f5795;
  color: #fff;
}
.content_table_formater .table td span.value,
.content_table_formater .table th span.value {
  display: block;
  width: 100%;
  padding: 0.75rem;
  white-space: nowrap;
  border: 1px solid #dee2e6;
  color: #0f5795;
}
.content_table_formater .table {
  text-align: center;
}
